                public void setBinding(Binding binding) {

                    super.setBinding(binding);
                    Map variables = binding.getVariables();

                    if (variables.containsKey("physicalNode")) {
                      physicalNode =  binding.getVariable("physicalNode");
                    }

                    if (variables.containsKey("generatorContext")) {
                      generatorContext =  (GeneratorContext) binding.getVariable("generatorContext");
                    }

                    credName = getOptionValue("CREDENTIAL_NAME");
                    if (credName.contains("'") || credName.contains('"')) {
                       throw new GenerationException("CREDENTIAL_NAME contains usupported characters : quotation marks")
                    }
                    binding.setVariable("credName", credName);

                    objectStorageSchemaName = getOptionValue("TEMP_OBJECT_STORAGE_SCHEMA");
                    if (objectStorageSchemaName == null || objectStorageSchemaName == "") {
                       throw new OdiKMException( "TEMP_OBJECT_STORAGE_SCHEMA option cannot be empty.");
                    }
                    binding.setVariable("objectStorageSchemaName", objectStorageSchemaName);

                    objStoreUser = '<%=odiRef.getDataServerPropertyFromLSchema( "User Name", "' + objectStorageSchemaName + '")%>';
                    binding.setVariable("objStoreUser", objStoreUser);

                    swiftPwd = '<%=odiRef.getDataServerInfo("SRC_SWIFT_PASS", "' + objectStorageSchemaName + '")%>'
                    binding.setVariable("swiftPwd", swiftPwd);

                    stagingName = generatorContext.getAPNodeCollTableAccessName();
                    binding.setVariable("stagingName", stagingName);

                    boolean isUnique = physicalNode.getPhysicalDesign().isConcurrent();

                    if (isUnique) {
                      stagingNameShort = '<?=odiRef.getObjectShortName("L", "' + "%COL_PRF" + physicalNode.getCollTableUniquenessDigits() + physicalNode.getStageTableName() + "%UNIQUE_STEP_TAG" + '", "W")?>'
                    } else {
                      stagingNameShort = '<?=odiRef.getObjectShortName("L", "' + "%COL_PRF" + physicalNode.getCollTableUniquenessDigits() + physicalNode.getStageTableName() + '", "W")?>'
                    }
                    binding.setVariable("stagingNameShort", stagingNameShort);

                    sourceSchemaName = getSourceSchemaName();
                    binding.setVariable("sourceSchemaName", sourceSchemaName);

                    sourceSchema = '<%=odiRef.getSchemaName("' + sourceSchemaName + '", "D")%>';
                    binding.setVariable("sourceSchema", sourceSchema);

                    sourceWorkSchema = '<%=odiRef.getSchemaName("' + sourceSchemaName + '", "W")%>';
                    binding.setVariable("sourceWorkSchema", sourceWorkSchema);

                    MapPhysicalNode sourceNode = getSourceNode();

                    sourceResourceName = getResourceName(sourceNode);
                    binding.setVariable("sourceResourceName", sourceResourceName);

                    exportFileName = getResourceName(physicalNode);
                    binding.setVariable("exportFileName", exportFileName);

                    tempSchema = getOptionValue("TEMP_FILE_SCHEMA")
                    if (tempSchema == null || tempSchema == "") {
                       throw new OdiKMException( "TEMP_FILE_SCHEMA option cannot be empty.");
                    }
                    binding.setVariable("tempSchema", tempSchema);

                    tempDirectory = '<%=odiRef.getObjectName("L", "", "' + tempSchema + '", "D")%>';
                    binding.setVariable("tempDirectory", tempDirectory);

                    tempWorkDirectory = '<%=odiRef.getObjectName("L", "", "' + tempSchema + '", "W")%>';
                    binding.setVariable("tempWorkDirectory", tempWorkDirectory);

                    oracleDirectory = getOptionValue("ORACLE_DIRECTORY_NAME");
                    if (oracleDirectory == null || oracleDirectory == "") { oracleDirectory = "ODI_DIR" }
                    oracleDirectory = oracleDirectory.toUpperCase()
                    binding.setVariable("oracleDirectory", oracleDirectory);

                    overwriteObjectStorageFiles = 'true';
                    binding.setVariable("overwriteObjectStorageFiles", overwriteObjectStorageFiles);

                    createSourceView = getOptionValue("CREATE_VIEW_ON_SOURCE");
                    binding.setVariable("createSourceView", createSourceView);

                    createSourceViewTempSchema = getOptionValue("CREATE_VIEW_ON_SOURCE_TEMP_SCHEMA");
                    binding.setVariable("createSourceViewTempSchema", createSourceViewTempSchema);

                    if (variables['subtype'] == "INSERT") {
                       def vQuery = buildViewQuery(generatorContext.getInputQuery())
                       if (vQuery != null) {
                          sqlText = vQuery.getText(getSourceNode().getTemplateUtils())
                       } else {
                          sqlText = ""
                       }
                    }

                    binding.setVariable("sqlText", sqlText);

                }

                public String getOptionValue(String optionName) throws AdapterException, GenerationException, MappingException {
                    return physicalNode.getOptionValue(IKnowledgeModule.ProcessingType.SOURCE, optionName).getOptionValueString();
                }

                MapPhysicalNode getSourceNode() {
                    return getSourceNode(physicalNode);
                }

                List<MapPhysicalNode> findSourceLeafNodes ( MapPhysicalNode node, List<MapPhysicalNode> leafNodes ) {
                   List<MapPhysicalNode> sourceNodes = node.getUpstreamConnectedNodes();
                   if (sourceNodes == null || sourceNodes.isEmpty()) {
                      leafNodes.add(node)
                   } else {
                     for ( MapPhysicalNode currentNode : sourceNodes ) {
                       findSourceLeafNodes (currentNode, leafNodes)
                     }
                   }
                   return leafNodes
                }

                MapPhysicalNode getSourceNode(MapPhysicalNode node) {
                   List<MapPhysicalNode> sourceNodes = findSourceLeafNodes(node, new ArrayList<MapPhysicalNode>())
                   for (MapPhysicalNode src : sourceNodes) {
                      if (src.getLogicalComponent().getBoundObject() != null &&
                          src.getExecutionUnit().getExecutionTechnology().getName().equals("Oracle") )
                      return src
                   }
                }

                public String getSourceSchemaName() {
                    return getSourceNode().getExecutionUnit().getLocation().getLogicalSchema().getName();
                }

                String getResourceName(MapPhysicalNode node) {

                    String resourceName = "";

                    if (node.isAPNode()) {
                         resourceName = "odi_" + '<%=odiRef.getSession("SESS_GUID")%>' + "_${node.getName()}";
                    } else {
                         OdiDataStore dataStore = (OdiDataStore)node.getLogicalComponent().getBoundObject();
                         resourceName = dataStore.getResourceName();
                    }
                }

                public List<String> getResourceList (String resourceName) {
                   def resources = resourceName.split(",")
                   def resourceList = []
                   resources.each {resourceList.add(it.trim())}
                   return resourceList
                }

                public SqlQuery createNewQueryForSelect(TemplateUtils templateUtils) {
                  return new SqlQuery(templateUtils);
                }

                public List<ISelectItem> getSelectExprList(String tableAlias) {
                  List<ISelectItem> result = new ArrayList<ISelectItem>();
                  List<MapPhysicalColumn> cols = physicalNode.getPhysicalColumns();
                  for (MapPhysicalColumn col : cols) {
                    result.add(new StringExpression(col.getSQLAccessName(tableAlias), col, col.getRefObject()));
                  }
                  return result;
                }

                AbstractSyntaxTree buildViewQuery (SqlQuery sqlQuery) {

                    if (sqlQuery != null) {
                      SqlQuery newQuery = sqlQuery.clone();

                      def inputSelectList = sqlQuery.getSelectList();
                      def newSelectList = [];
                      def inputAliasList = sqlQuery.getAliasList();
                      def newAliasList = [];

                      def nodeAttributes = [];
		      def nodeColumns = [];
                      physicalNode.getPhysicalColumns().each {
                        nodeAttributes.add(it.getReferencedAttribute())
			nodeColumns.add(it)
                      }
                      if (inputAliasList != null) {
                       for (i in [inputSelectList,inputAliasList].transpose()) {
                        if (nodeAttributes.contains(i[0].getRefAttributeWithPath().getAttribute())) {
			   def colIdx = nodeAttributes.findIndexOf{it == i[0].getRefAttributeWithPath().getAttribute()};
                           newSelectList.add(i[0]);
			   if (createSourceView.equals('true')) {
			     newAliasList.add(new StringExpression(nodeColumns[colIdx].getName()));
			   } else {
                             newAliasList.add(i[1]);
			   }
                        }
                       }
                      } else {
                       for (i in inputSelectList) {
                        if (nodeAttributes.contains(i.getRefAttributeWithPath().getAttribute())) {
			   def colIdx = nodeAttributes.findIndexOf{it == i.getRefAttributeWithPath().getAttribute()};
                           newSelectList.add(i);
			   if (createSourceView.equals('true')) {
                              newAliasList.add(new StringExpression(nodeColumns[colIdx].getName()));
                           }
                        }
                       }
                      }
		      if (!newAliasList.isEmpty()) {
		         newQuery.setAliasList(newAliasList);
		      }
                      newQuery.setSelectList(newSelectList);
                      return newQuery;
                    } else {
                      return sqlQuery;
                    }
                }

                def removeQualifier (IConditionItem filterExpression, String alais) {
                     ArrayExpression expr = filterExpression.getArrayExpression();
                     Map<String,Object> childMap = expr.getChildMap()

                     for (child in childMap) {
                       String key = child.key
                       Object oldExpr =  child.value

                       if (oldExpr instanceof StringExpression) {
                         String exprText = oldExpr.getText()
                         if (exprText.contains(".")) {
                           if (exprText.split("\\.").size() > 1 && exprText.split("\\.")[0].equals(alais)) {
                               exprText = exprText.split("\\.")[1];
                           }
                         }

                         StringExpression newExpr = new StringExpression(exprText, oldExpr.getMappingObject(), oldExpr.getRefObject());
                         childMap[child.key] = newExpr
                       }
                     }

                     expr.setChildMap(childMap)
                     return expr
                }

                AbstractSyntaxTree SELECT (SqlQuery sqlQuery) throws AdapterException, MappingException, GenerationException {

                    String tableName = physicalNode.getStageTableName();
                    String tableAlias = physicalNode.getStageTableAlias();

                    SqlQuery result = createNewQueryForSelect(physicalNode.getTemplateUtils(true));

                    Table srcTable = new Table(tableName, null, stagingName, physicalNode);
                    String tableAliasSeparator = physicalNode.getExecutionTechnology().getTableAliasSeparator();
                    FromClause from = new FromClause(new TableReference(srcTable), tableAlias, tableAliasSeparator == null ? " " : tableAliasSeparator);
                    List<FromClause> fromList = new ArrayList<FromClause>();
                    fromList.add(from);
                    result.setFromList(fromList);
                    result.setSelectList(getSelectExprList(tableAlias));

                    return result;
                }


                AbstractSyntaxTree INSERT (SqlQuery sqlQuery) throws AdapterException, MappingException, GenerationException {

                    String objectStorageSchema = '<%=odiRef.getSchemaName("' + objectStorageSchemaName + '", "D")%>';
                    String region = '<%=odiRef.getDataServerPropertyFromLSchema( "Region", "' + objectStorageSchemaName + '")%>'
                    String tenant = '<%=odiRef.getDataServerPropertyFromLSchema( "Tenant Name", "' + objectStorageSchemaName + '")%>'
                    String objectStorageURL = "https://swiftobjectstorage." + region + ".oraclecloud.com/v1/" + tenant + "/" + objectStorageSchema
                    String targetLocation = physicalNode.getExecutionUnit().getLocation().getLogicalSchema().getName();
                    String stagingSchema = '<%=odiRef.getSchemaName("' + targetLocation + '", "W")%>';
                    String sourceUser = '<?=odiRef.getDataServerInfo("USER_NAME", "' + sourceSchemaName + '").toUpperCase()?>'

                    String compressionType = getOptionValue("COMPRESSION");
                    String compressionAlgorithm = getOptionValue("COMPRESSION_ALGORITHM");
                    String useGroupPartitionTableData = getOptionValue("USE_GROUP_PARTITION_TABLE_DATA");

                    List<String> sqlFilter = new ArrayList<FromClause>();
                    List<IConditionItem> whereList = sqlQuery.getWhereList();
                    List<java.lang.String> aliasList = sqlQuery.getFromList().get(0).getAliasList();
                    String alias = "";
                    if (aliasList != null && !aliasList.isEmpty()) { alias = aliasList.get(0) }

                    if (whereList != null && !whereList.isEmpty()) {
                       whereList.each() {
                          sqlFilter.add(removeQualifier(it, alias).getText(getSourceNode().getTemplateUtils()))
                       }
                    }

                    DataPump dataPumpStatement = new DataPump (stagingNameShort,
                                                               stagingSchema,
                                                               sourceSchema,
                                                               sourceWorkSchema,
                                                               sourceResourceName,
                                                               sourceUser,
                                                               credName,
                                                               objectStorageURL,
                                                               oracleDirectory,
                                                               exportFileName,
                                                               compressionType,
                                                               compressionAlgorithm,
                                                               useGroupPartitionTableData,
                                                               createSourceView,
                                                               createSourceViewTempSchema,
                                                               sqlFilter)

                    dataPumpStatement.setIsPushFromSource(true);
		    return dataPumpStatement;
                }
            }


