                public String getText(TemplateUtils templateUtils) throws GenerationException {
                    String template = getSelectedTemplate(templateUtils);
                    HashMap templateVar = getTemplateSubstitutionMap();

                    try {
                      String result = oracle.odi.mapping.generation.parser.TemplateParser.mainCodeParser(templateUtils, templateVar, template);
                      return result;
                    } catch (oracle.odi.mapping.generation.parser.ParseException e) {
                      Throwable cause = e.getCause();
                      if (cause instanceof GenerationException) {
                        throw (GenerationException)cause;
                      }
                      throw new GenerationException("Template parser exception: " + e.getMessage(), e);
                    }
                }

                public Map<String,Object> getTemplateSubstitutionMap() {
                  HashMap<String,Object> templateVar = new HashMap<String,Object>();
                  templateVar.put("statement", this);
                  return templateVar;
